script: |
  super -f text -I q8357.spq | sort > q8357.out

inputs:
  - name: q8357.spq
    data: |
      SELECT - col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 BETWEEN ( + - 54 * - 16 ) AND + col0 * col1 + + col2;
  - name: tab1

outputs:
  - name: q8357.out
    data: |
      -14
      -47
      -5
